{Log[c*(a + b*x^2)^p]/x^3, x, 5, (b*p*Log[x])/a - ((a + b*x^2)*Log[c*(a + b*x^2)^p])/(2*a*x^2), (b*p*Log[x])/a - (b*p*Log[a + b*x^2])/(2*a) - Log[c*(a + b*x^2)^p]/(2*x^2)}
