{x^1*Log[c*(a + b*x^3)^p], x, 8, -((3*p*x^2)/4) - (Sqrt[3]*a^(2/3)*p*ArcTan[(a^(1/3) - 2*b^(1/3)*x)/(Sqrt[3]*a^(1/3))])/(2*b^(2/3)) - (a^(2/3)*p*Log[a^(1/3) + b^(1/3)*x])/(2*b^(2/3)) + (a^(2/3)*p*Log[a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2])/(4*b^(2/3)) + (1/2)*x^2*Log[c*(a + b*x^3)^p]}
{x^0*Log[c*(a + b*x^3)^p], x, 8, -3*p*x - (Sqrt[3]*a^(1/3)*p*ArcTan[(a^(1/3) - 2*b^(1/3)*x)/(Sqrt[3]*a^(1/3))])/b^(1/3) + (a^(1/3)*p*Log[a^(1/3) + b^(1/3)*x])/b^(1/3) - (a^(1/3)*p*Log[a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2])/(2*b^(1/3)) + x*Log[c*(a + b*x^3)^p]}
{Log[c*(a + b*x^3)^p]/x^1, x, 3, (1/3)*Log[-((b*x^3)/a)]*Log[c*(a + b*x^3)^p] + (1/3)*p*PolyLog[2, 1 + (b*x^3)/a]}
{Log[c*(a + b*x^3)^p]/x^2, x, 7, -((Sqrt[3]*b^(1/3)*p*ArcTan[(a^(1/3) - 2*b^(1/3)*x)/(Sqrt[3]*a^(1/3))])/a^(1/3)) - (b^(1/3)*p*Log[a^(1/3) + b^(1/3)*x])/a^(1/3) + (b^(1/3)*p*Log[a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2])/(2*a^(1/3)) - Log[c*(a + b*x^3)^p]/x}
