{Log[c*(a + b*x^3)^p]/x^4, x, 5, (b*p*Log[x])/a - (b*p*Log[a + b*x^3])/(3*a) - Log[c*(a + b*x^3)^p]/(3*x^3)}
{Log[c*(a + b*x^3)^p]/x^5, x, 8, -((3*b*p)/(4*a*x)) + (Sqrt[3]*b^(4/3)*p*ArcTan[(a^(1/3) - 2*b^(1/3)*x)/(Sqrt[3]*a^(1/3))])/(4*a^(4/3)) + (b^(4/3)*p*Log[a^(1/3) + b^(1/3)*x])/(4*a^(4/3)) - (b^(4/3)*p*Log[a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2])/(8*a^(4/3)) - Log[c*(a + b*x^3)^p]/(4*x^4)}
{Log[c*(a + b*x^3)^p]/x^6, x, 8, -((3*b*p)/(10*a*x^2)) + (Sqrt[3]*b^(5/3)*p*ArcTan[(a^(1/3) - 2*b^(1/3)*x)/(Sqrt[3]*a^(1/3))])/(5*a^(5/3)) - (b^(5/3)*p*Log[a^(1/3) + b^(1/3)*x])/(5*a^(5/3)) + (b^(5/3)*p*Log[a^(2/3) - a^(1/3)*b^(1/3)*x + b^(2/3)*x^2])/(10*a^(5/3)) - Log[c*(a + b*x^3)^p]/(5*x^5)}
{Log[c*(a + b*x^3)^p]/x^7, x, 4, -((b*p)/(6*a*x^3)) - (b^2*p*Log[x])/(2*a^2) + (b^2*p*Log[a + b*x^3])/(6*a^2) - Log[c*(a + b*x^3)^p]/(6*x^6)}


