{(f*x)^m*Log[c*(d + e*x^2)^p], x, 3, -((2*e*p*(f*x)^(3 + m)*Hypergeometric2F1[1, (3 + m)/2, (5 + m)/2, -((e*x^2)/d)])/(d*f^3*(1 + m)*(3 + m))) + ((f*x)^(1 + m)*Log[c*(d + e*x^2)^p])/(f*(1 + m))}
{(f*x)^m*Log[c*(d + e*x^1)^p], x, 2, -((e*p*(f*x)^(2 + m)*Hypergeometric2F1[1, 2 + m, 3 + m, -((e*x)/d)])/(d*f^2*(1 + m)*(2 + m))) + ((f*x)^(1 + m)*Log[c*(d + e*x)^p])/(f*(1 + m))}
{(f*x)^m*Log[c*(d + e/x^1)^p], x, 4, (e*p*(f*x)^m*Hypergeometric2F1[1, -m, 1 - m, -(e/(d*x))])/(d*m*(1 + m)) + ((f*x)^(1 + m)*Log[c*(d + e/x)^p])/(f*(1 + m))}
{(f*x)^m*Log[c*(d + e/x^2)^p], x, 4, -((2*e*f*p*(f*x)^(-1 + m)*Hypergeometric2F1[1, (1 - m)/2, (3 - m)/2, -(e/(d*x^2))])/(d*(1 - m^2))) + ((f*x)^(1 + m)*Log[c*(d + e/x^2)^p])/(f*(1 + m))}
{(f*x)^m*Log[c*(d + e/x^3)^p], x, 4, -((3*e*f^2*p*(f*x)^(-2 + m)*Hypergeometric2F1[1, (2 - m)/3, (5 - m)/3, -(e/(d*x^3))])/(d*(2 + m - m^2))) + ((f*x)^(1 + m)*Log[c*(d + e/x^3)^p])/(f*(1 + m))}


{(f*x)^m*Log[c*(d + e*Sqrt[x])^p], x, 4, If[$VersionNumber>=8, -((e*p*x^(3/2)*(f*x)^m*Hypergeometric2F1[1, 3 + 2*m, 2*(2 + m), -((e*Sqrt[x])/d)])/(d*(3 + 5*m + 2*m^2))) + ((f*x)^(1 + m)*Log[c*(d + e*Sqrt[x])^p])/(f*(1 + m)), -((e*p*x^(3/2)*(f*x)^m*Hypergeometric2F1[1, 3 + 2*m, 2*(2 + m), -((e*Sqrt[x])/d)])/(d*(1 + m)*(3 + 2*m))) + ((f*x)^(1 + m)*Log[c*(d + e*Sqrt[x])^p])/(f*(1 + m))]}
{(f*x)^m*Log[c*(d + e/Sqrt[x])^p], x, 5, (p*x*(f*x)^m*Hypergeometric2F1[1, 2*(1 + m), 3 + 2*m, -((d*Sqrt[x])/e)])/(2*(1 + m)^2) + ((f*x)^(1 + m)*Log[c*(d + e/Sqrt[x])^p])/(f*(1 + m))}


