{(f*x)^(3*n - 1)*Log[c*(d + e*x^n)^p], x, 5, -((p*(f*x)^(3*n))/(9*f*n)) - (d^2*p*(f*x)^(3*n))/(x^(2*n)*(3*e^2*f*n)) + (d*p*(f*x)^(3*n))/(x^n*(6*e*f*n)) + (d^3*p*(f*x)^(3*n)*Log[d + e*x^n])/(x^(3*n)*(3*e^3*f*n)) + ((f*x)^(3*n)*Log[c*(d + e*x^n)^p])/(3*f*n)}
